import classes from "./Footer.module.css";

function Footer() {
  return (
    <div className={classes.footerNavigation}>
      <ul>
        <li>Home</li>
        <li>Yoga</li>
        <li>Coaching</li>
        <li>About</li>
        <li>Contact</li>
        <li>Privacy Policy</li>
      </ul>
    </div>
  );
}

export default Footer;
